#!/bin/bash


# Function to check if a command is available
check_command() {
    command -v "$1" >/dev/null 2>&1
}

# Function to install a package if not installed
install_package() {
    echo "Installing $1... as sudo; please input your password if needed"
    sudo apt-get update
    sudo apt-get install -y "$1"
}

# Check and install base64 if not installed
if ! check_command base64; then
    echo "Installing base64 package..."
    install_package coreutils
fi

# Check and install wget if not installed
if ! check_command wget; then
    echo "Installing wget package..."
    install_package wget
fi

# Check and install ifconfig if not installed
if ! check_command ifconfig; then
    echo "Installing net-tools package..."
    install_package net-tools
fi

